import React, { Component, PropTypes } from 'react';
import ReactDom from 'react-dom';

export default class Image extends Component {
  constructor(props){
    super(props);
    this.handleScroll = this.handleScroll.bind(this);
    this.state = {visible:false};
    this.placeholder = 'data:image/png;base64,';
  }
  
  static propTypes = {
    src: PropTypes.string.isRequired,
    containerId: PropTypes.string.isRequired
  };
  
  componentDidMount(){
    const { containerId } = this.props;
    this.handleScroll();
    window.document.getElementById(containerId).addEventListener('scroll', this.handleScroll);
  }

  componentWillUnmount(){
    const { containerId } = this.props;
    window.document.getElementById(containerId).removeEventListener('scroll', this.handleScroll);
  }

  handleScroll(){
    if(!this.state.visible && this.isVisible(ReactDom.findDOMNode(this))){
      this.setState({ visible: true });
    }
  }

  isVisible (el) {
    var rect = el.getBoundingClientRect();
    return (
      rect.top >= 0 &&
      rect.left >= 0 &&
      rect.top <= window.innerHeight &&
      rect.left <= window.innerHeight
    );
  }

  
  render() {
    const { src } = this.props;
    return (
      <img width="100%" className={this.state.visible && 'fadeIn'} src={ this.state.visible ? src : this.placeholder }/>
    );
  }
}